    false,nt"url": null,nt"notes": "This narrative report for Parker River
    National Wildlife Refuge outlines Refuge accomplishments from September through
    December of 1945. The report begins by summarizing the weather conditions, water
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, and rodents-
    is also covered. The public relations section of the report describes Refuge visitors.
